import './Home.scss';


var google = document.getElementById("google");

google.scrollIntoView({
  behavior: "smooth",
  block: "start",
  inline: "nearest"
});

var facebook = document.getElementById("facebook");

facebook.scrollIntoView({
  behavior: "smooth",
  block: "start",
  inline: "nearest"
});


function Home() {
  return (
    <div className="home">
      <a href="#">click to go to google</a><br/>
      <a href="#">click to go to facebook</a>
      <div className="google" id="google">google</div>
      <div className="facebook" id="facebook">facebook</div>
    </div>
  )
}

export default Home;
